def colget(r,g,b):
	n = 0
	d = 999999999
	for i in range(len(col2arr)):
		dr = r-col2arr[i][0]
		dg = g-col2arr[i][1]
		db = b-col2arr[i][2]
		td = np.sqrt(dr*dr+dg*dg+db*db)
		if td < d:
			n = i
			d = td
	return((n,d))

